import "./App.css";
import HeaderComponent from "./Components/Header/Header";
import Navbar from "./Components/Navbar/Navbar";
import AboutSection from "./Components/Sections/About/AboutSection"

function App() {
  return (
      <div className="container-fluid" style={{
          backgroundImage: "url('https://imageio.forbes.com/blogs-images/yjeanmundelsalle/files/2019/06/01_A-painting-by-Dr-Esther-Mahlangu-1200x805.jpg?format=jpg&width=1200')",
          backgroundSize: "cover",
          backgroundPosition: "center",
          height: "720px"}}>
          <HeaderComponent />
          <Navbar />
          <AboutSection />
      </div>
  );
}

export default App;
